import react from "react";

const HeaderPage = () => {
    return (
        <>
            <header>
                PROJETO TESTE
            </header>

            <nav>
                <ul>
                    <li>Home</li>
                    <li>Sobre</li>
                </ul>
            </nav>
        </>
    );
}
